        <tspan x="27" y="29.952" font-family="Calibri" font-size="24pt">It has been said that something as small as the</tspan>

        <tspan x="27" y="106.752" font-family="Calibri" font-size="24pt">cause a typhoon halfway around the world.</tspan>
        <tspan x="0" y="152.832">•</tspan>
        <tspan x="27" y="152.832" font-family="Calibri" font-size="24pt">Chinese P</tspan>
        <tspan x="0" y="198.912">•</tspan>
        <tspan x="27" y="198.912" font-family="Calibri" font-size="24pt">Your acts are effecting someone somewhere</tspan>
